import React from 'react'
import { v4 as uuidv4 } from 'uuid';

const ArtItems = [
  {title: "Art", description: "", image: require("./../img/art/building.jpg")},
  {title: "About", description: "", image: require("./../img/art/coffee.jpg")}
  // {title: "More", description: "", image: ArtDirectory + "fallentree.jpg"}
]

const Art = () => {
  return (
    <div>
      <img src={require('./../img/art/building.jpg')} alt="nope"/>
      {ArtItems.map((artItem, i) => {
        return <img 
          key={uuidv4()}
          src={artItem.image}
          alt={artItem.title}
          />
      })}
    </div>
  )
}

export default Art
